import { BrowserRouter as Router, Route, NavLink } from 'react-router-dom'
import HomePage from './pages/HomePages'


function App() {
  return (
    <div className="App">
      Hello



      <Router>
        <Route>
          <NavLink path='/' element={<HomePage />} />

        </Route>
      </Router>
    </div>
  );
}

export default App;
